    public static void InitializePagesAndSingletons(MonadicComponentsContext context) {
      context.Database.EnsureCreated();
      
      if (!context.HomePage.Any()) {
        var root = new HomePage() { CreatedDate = DateTime.Now,  };
        HomePages = new [] {root};
        context.HomePage.Add(root);
        context.SaveChanges();
      } else {
        HomePages = context.HomePage.ToArray();
      }
      seed_HomePages = () => {};
        
    }

